;; <=

;; **
;;; ## Grading the professor
;; **

;; **
;;; Many college courses conclude by giving students the opportunity to evaluate 
;;; the course and the instructor anonymously. However, the use of these student 
;;; evaluations as an indicator of course quality and teaching effectiveness is 
;;; often criticized because these measures may reflect the influence of 
;;; non-teaching related characteristics, such as the physical appearance of the 
;;; instructor. The article titled, "Beauty in the classroom: instructors' 
;;; pulchritude and putative pedagogical productivity" (Hamermesh and Parker, 2005) 
;;; found that instructors who are viewed to be better looking receive higher 
;;; instructional ratings. (Daniel S. Hamermesh, Amy Parker, Beauty in the 
;;; classroom: instructors pulchritude and  putative pedagogical productivity, 
;;; *Economics of Education Review*, Volume 24, Issue 4, August 2005, Pages 369-376, 
;;; ISSN 0272-7757, 10.1016/j.econedurev.2004.07.013. [http://www.sciencedirect.com/science/article/pii/S0272775704001165](http://www.sciencedirect.com/science/article/pii/S0272775704001165).)
;;; 
;;; In this lab we will analyze the data from this study in order to learn what goes 
;;; into a positive professor evaluation.
;; **

;; **
;;; ## The data
;; **

;; **
;;; The data were gathered from end of semester student evaluations for a large 
;;; sample of professors from the University of Texas at Austin. In addition, six 
;;; students rated the professors' physical appearance. (This is aslightly modified 
;;; version of the original data set that was released as part of the replication 
;;; data for *Data Analysis Using Regression and Multilevel/Hierarchical Models* 
;;; (Gelman and Hill, 2007).) The result is a data frame where each row contains a 
;;; different course and columns represent variables about the courses and professors.
;; **

;; @@
(def evals (iio/read-dataset "../data/evals.csv" :header true))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;openintro.multiple-regression/evals</span>","value":"#'openintro.multiple-regression/evals"}
;; <=

;; **
;;; variable         | description
;;; ---------------- | -----------
;;; `score`          | average professor evaluation score: (1) very unsatisfactory - (5) excellent.
;;; `rank`           | rank of professor: teaching, tenure track, tenured.
;;; `ethnicity`      | ethnicity of professor: not minority, minority.
;;; `gender`         | gender of professor: female, male.
;;; `language`       | language of school where professor received education: english or non-english.
;;; `age`            | age of professor.
;;; `cls_perc_eval`  | percent of students in class who completed evaluation.
;;; `cls_did_eval`   | number of students in class who completed evaluation.
;;; `cls_students`   | total number of students in class.
;;; `cls_level`      | class level: lower, upper.
;;; `cls_profs`      | number of professors teaching sections in course in sample: single, multiple.
;;; `cls_credits`    | number of credits of class: one credit (lab, PE, etc.), multi credit.
;;; `bty_f1lower`    | beauty rating of professor from lower level female: (1) lowest - (10) highest.
;;; `bty_f1upper`    | beauty rating of professor from upper level female: (1) lowest - (10) highest.
;;; `bty_f2upper`    | beauty rating of professor from second upper level female: (1) lowest - (10) highest.
;;; `bty_m1lower`    | beauty rating of professor from lower level male: (1) lowest - (10) highest.
;;; `bty_m1upper`    | beauty rating of professor from upper level male: (1) lowest - (10) highest.
;;; `bty_m2upper`    | beauty rating of professor from second upper level male: (1) lowest - (10) highest.
;;; `bty_avg`        | average beauty rating of professor.
;;; `pic_outfit`     | outfit of professor in picture: not formal, formal.
;;; `pic_color`      | color of professor's picture: color, black & white.
;; **

;; **
;;; ## Exploring the data
;; **

;; **
;;; *1.  Is this an observational study or an experiment? The original research
;;;     question posed in the paper is whether beauty leads directly to the
;;;     differences in course evaluations. Given the study design, is it possible to
;;;     answer this question as it is phrased? If not, rephrase the question.*
;;; 
;;; *2.  Describe the distribution of `score`. Is the distribution skewed? What does 
;;;     that tell you about how students rate courses? Is this what you expected to 
;;;     see? Why, or why not?*
;;; 
;;; *3.  Excluding `score`, select two other variables and describe their relationship 
;;;     using an appropriate visualization (scatterplot, side-by-side boxplots, or 
;;;     grouping bar plot).*
;; **

;; **
;;; ## Simple linear regression
;; **

;; **
;;; The fundamental phenomenon suggested by the study is that better looking teachers
;;; are evaluated more favorably. Let's create a scatterplot to see if this appears 
;;; to be the case:
;; **

;; @@
(chart-view
  (c/scatter-plot (i/$ :bty_avg evals) (i/$ :score evals)
                  :x-label "Average beauty rating"
                  :y-label "Score"))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#incanter_gorilla.render.ChartView{:content #object[org.jfree.chart.JFreeChart 0x1dc6c857 \"org.jfree.chart.JFreeChart@1dc6c857\"], :opts nil}"}
;; <=

;; **
;;; Before we draw conclusions about the trend, compare the number of observations 
;;; in the data frame with the approximate number of points on the scatterplot. 
;;; Is anything awry?
;; **

;; **
;;; *4.  Let's see if the apparent trend in the plot is something more than
;;;     natural variation. Fit a linear model called `m_bty` to predict average
;;;     professor score by average beauty rating and add the regression line 
;;;     to your plot. Write out the equation for the linear model and
;;;     interpret the slope. Is average beauty score a statistically significant
;;;     predictor? Does it appear to be a practically significant predictor?*
;;; 
;;; *5.  Use residual plots to evaluate whether the conditions of least squares
;;;     regression are reasonable. Provide plots and comments for each one (see
;;;     the Simple Regression Lab for a reminder of how to make these).*
;; **

;; **
;;; ## Multiple linear regression
;; **

;; **
;;; The data set contains several variables on the beauty score of the professor: 
;;; individual ratings from each of the six students who were asked to score the 
;;; physical appearance of the professors and the average of these six scores. Let's 
;;; take a look at the relationship between one of these scores and the average 
;;; beauty score.
;; **

;; @@
(chart-view
  (c/scatter-plot (i/$ :bty_f1lower evals) (i/$ :bty_avg evals)))

(s/correlation (i/$ :bty_avg evals) (i/$ :bty_f1lower evals))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>0.8439111692147884</span>","value":"0.8439111692147884"}
;; <=

;; **
;;; As expected the relationship is quite strong - after all, the average score is 
;;; calculated using the individual scores. We can actually take a look at the 
;;; relationships between all beauty variables (columns 13 through 19) using the 
;;; following command:
;; **

;; @@
(chart-view 
  (c/scatter-plot-matrix (i/sel evals :cols (range 12 19)))
  :plot-size 900 :aspect-ratio 1)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#incanter_gorilla.render.ChartView{:content #object[org.jfree.chart.JFreeChart 0x1abe8dee \"org.jfree.chart.JFreeChart@1abe8dee\"], :opts (:plot-size 900 :aspect-ratio 1)}"}
;; <=

;; **
;;; These variables are collinear (correlated), and adding more than one of these 
;;; variables to the model would not add much value to the model. In this 
;;; application and with these highly-correlated predictors, it is reasonable to use
;;; the average beauty score as the single representative of these variables.
;;; 
;;; In order to see if beauty is still a significant predictor of professor score 
;;; after we've accounted for the gender of the professor, we can add the gender 
;;; term into the model.
;; **

;; @@
(def m-bty-gen
  (s/linear-model (i/$ :score evals)
                  (i/to-matrix (i/sel evals :cols [:bty_avg :gender]) :dummies true)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;openintro.multiple-regression/m-bty-gen</span>","value":"#'openintro.multiple-regression/m-bty-gen"}
;; <=

;; **
;;; Summaries of the model:
;; **

;; @@
(println (clojure.string/join "residuals Min., 1st Qu., Median, 3rd Qu and Max.:"))
(println (clojure.string/join "\t" (s/quantile (m-bty-gen :residuals))))

(println "Coefficients for Intercept, bty_avg and gendermale:")
(println "Estimates")
(println (m-bty-gen :coefs))
(println "Std. Errors")
(println (m-bty-gen :std-errors))
(println "t values:")
(println (m-bty-gen :t-tests))
(println "t probs:")
(println (m-bty-gen :t-probs))

(print "Multiple R-squared: ")
(println (m-bty-gen :r-square))
(print "Adjusted R-squared: ")
(println (m-bty-gen :adj-r-square))
(print "F-statistic: ")
(println (m-bty-gen :f-stat))
(print "DF: ")
(println (m-bty-gen :df))

