;; **
;;; *6.  P-values and parameter estimates should only be trusted if the
;;;     conditions for the regression are reasonable. Verify that the conditions
;;;     for this model are reasonable using diagnostic plots.*
;;; 
;;; *7.  Is `bty_avg` still a significant predictor of `score`? Has the addition
;;;     of `gender` to the model changed the parameter estimate for `bty_avg`?*
;; **

;; **
;;; Note that we use dummy encoding for `gender` categorical variable.
;;; So the result of encoding takes a value of @@0@@ for females and
;;; a value of @@1@@ for males.
;; **

;; **
;;; As a result of `gender` encoding, for females, the parameter estimate is multiplied by zero, leaving 
;;; the intercept and slope form familiar from simple regression.
;;; 
;;; $$
;;;   \begin{aligned}
;;; \widehat{score} &= \hat{\beta}_0 + \hat{\beta}_1 \times bty\_avg + \hat{\beta}_2 \times (0) = \hat{\beta}_0 + \hat{\beta}_1 \times bty\_avg\end{aligned}
;;; $$
;; **

;; **
;;; *8.  What is the equation of the line corresponding to males? (*Hint:* For
;;;     males, the parameter estimate is multiplied by 1.) For two professors
;;;     who received the same beauty rating, which gender tends to have the
;;;     higher course evaluation score?*
;; **

;; **
;;; *9. Create a new model called `m_bty_rank` with `gender` removed and `rank` 
;;;     added in. How to handle categorical variables that have more 
;;;     than two levels? Note that the rank variable has three levels: `teaching`, 
;;;     `tenure track`, `tenured`.*
;; **

;; **
;;; The interpretation of the coefficients in multiple regression is slightly 
;;; different from that of simple regression. The estimate for `bty_avg` reflects
;;; how much higher a group of professors is expected to score if they have a beauty
;;; rating that is one point higher *while holding all other variables constant*. In
;;; this case, that translates into considering only professors of the same rank 
;;; with `bty_avg` scores that are one point apart.
;; **

;; **
;;; ## The search for the best model
;; **

;; **
;;; We will start with a full model that predicts professor score based on rank, 
;;; ethnicity, gender, language of the university where they got their degree, age, 
;;; proportion of students that filled out evaluations, class size, course level, 
;;; number of professors, number of credits, average beauty rating, outfit, and 
;;; picture color.
;; **

;; **
;;; *10. Which variable would you expect to have the highest p-value in this model? 
;;;     Why? *Hint:* Think about which variable would you expect to not have any 
;;;     association with the professor score.*
;; **

;; **
;;; Let's run the model...
;; **

;; @@
(def m-full
  (s/linear-model
    (i/$ :score evals)
    (i/to-matrix 
      (i/sel evals :cols [:rank :ethnicity :gender :language :age :cls_perc_eval
                          :cls_students :cls_level :cls_profs :cls_credits :bty_avg
                          :pic_outfit :pic_color] )
      :dummies true)))
